import React from 'react'
import UserList from './UserList'

function UserPage({ users, currentUser, onAcquireArtwork, acquisitions }){

    const aUser =
        users.map((eachUser) => {
            return <UserList
                key={eachUser.id}
                eachUser={eachUser}
                cUId={currentUser.id}
                onAcquireArtwork={onAcquireArtwork}
                />
        }
        )
        console.log(users)
    return (
        <div >
            {aUser}
        </div>
    );
}
export default UserPage;





